mini.</strong> Huius, Lyco, oratione locuples, rebus ipsis ielunior. </p>\n<p>Nihil opus est exemplis hoc facere longius. Quid est enim aliud esse versutum? Poterat autem inpune; Ratio enim nostra consentit, pugnat oratio. Non autem hoc: igitur ne illud quidem. Non quam nostram quidem, inquit Pomponius iocans; Perge porro; </p>\n<p>At iam decimum annum in spelunca iacet. Sed residamus, inquit, si placet. Qualem igitur hominem natura inchoavit? Universa enim illorum ratione cum tota vestra confligendum puto. </p>\n<ol>\n	<li>An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia?</li>\n	<li>Itaque ab his ordiamur.</li>\n	<li>Sed finge non solum callidum eum, qui aliquid improbe faciat, verum etiam praepotentem, ut M.</li>\n	<li>Est tamen ea secundum naturam multoque nos ad se expetendam magis hortatur quam superiora omnia.</li>\n</ol>\n<p>Sic consequentibus vestris sublatis prima tolluntur. <mark>Utilitatis causa amicitia est quaesita.</mark> Duarum enim vitarum nobis erunt instituta capienda. Duo Reges: constructio interrete. </p>\n<ul>\n	<li>Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers?</li>\n	<li>Nec vero sum nescius esse utilitatem in historia, non modo voluptatem.</li>\n	<li>Sint modo partes vitae beatae.</li>\n	<li>Qui est in parvis malis.</li>\n</ul>\n<p>Quae similitudo in genere etiam humano apparet. Quam ob rem tandem, inquit, non satisfacit? ALIO MODO. An nisi populari fama? Quam ob rem tandem, inquit, non satisfacit? <mark>Recte, inquit, intellegis.</mark> </p>\n<p>An nisi populari fama? Audeo dicere, inquit. Laboro autem non sine causa; Ut aliquid scire se gaudeant? </p>\n<p>Sed ea mala virtuti magnitudine obruebantur. Restatis igitur vos; </p>','normal','normal',NULL,'normal',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(104,210,1,'2022-02-19 06:43:08','2022-02-19 06:43:08','61c66006-c80d-41c5-b09a-3