INSERT INTO `stc_7_items` VALUES (32,481,2,'2022-02-21 02:43:41','2022-02-21 02:43:41','4d86e27c-3850-475d-a2e0-0485aa98e752','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>','Lorem ipsum'),(33,482,2,'2022-02-21 02:43:41','2022-02-21 02:43:41','70a80e4e-90d3-4e2c-86d9-0a7b03b4d831','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam. Quid est, quod ab ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>','Chrysippo praetermissum'),(34,483,2,'2022-02-21 02:43:41','2022-02-21 02:43:41','b57ee1c9-c245-44b2-bad2-cba16dc4476a','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Quae si potest singula consolando levare, universa quo modo sustinebit? Frater et T. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus.</p>','Nummus in Croesi'),(62,607,2,'2022-02-21 19:05:23','2022-02-21 19:05:23','84096850-8798-4810-9d53-a4b922a76b64','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>','Lorem ipsum'),(63,608,2,'2022-02-21 19:05:23','2022-02-21 19:05:23','a0e37744-089f-4088-8885-09c43dd4b939','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non vid