t? Frater et T. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus.</p>','Nummus in Croesi'),(140,721,2,'2022-02-21 19:13:54','2022-02-22 07:13:11','6732b6de-5105-469a-80e9-d40eb7351e78','<h2>Lorem ipsum dolor sit amet</h2>\n<p>Consectetur adipiscing elit. Urgent tamen et nihil remittunt. Equidem e Cn. Quid ait Aristoteles reliquique Platonis alumni? Duo Reges: constructio interrete. At certe gravius. Hoc loco tenere se Triarius non potuit. Ratio quidem vestra sic cogit. Dat enim intervalla et relaxat.<br /></p><ul class=\"checkmarks\"><li>At ego quem huic anteponam non audeo dicere; Quis negat? Nos commodius agimus. Honesta oratio, Socratica, Platonis etiam.</li><li>Quippe: habes enim a rhetoribus; Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Quod totum contra est. Tria genera bonorum;</li></ul>\n<p>Tum Torquatus: Prorsus, inquit, assentior; Nos commodius agimus. Quid ergo hoc loco intellegit honestum? Ecce aliud simile dissimile. Estne, quaeso, inquam, sitienti in bibendo voluptas? Vide, quantum, inquam, fallare, Torquate. Nullus est igitur cuiusquam dies natalis.</p>','Lorem ipsum'),(141,722,2,'2022-02-21 19:13:54','2022-02-22 07:13:11','474ac0f1-7760-45b6-8735-90865fb66d99','<p>Iam contemni non poteris. Haec et tu ita posuisti, et verba vestra sunt. Zenonis est, inquam, hoc Stoici. Sed quid sentiat, non videtis. Eadem nunc mea adversum te oratio est. Inde igitur, inquit, ordiendum est. Scrupulum, inquam, abeunti;<br /><br />Pauca mutat vel plura sane; Duo Reges: constructio interrete. Teneo, inquit, finem illi videri nihil dolere. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Non laboro, inquit, de nomine.<br /><br />Eadem nunc mea adversum te oratio est. Sed ego in hoc resisto; Deprehensus omnem poenam contemnet. At cum de plurimis eadem dicit, tum certe de maximis. Respondent extrema primis, media utrisque, omnia omnibus. Facillimum id quidem est, inquam.<br /><br />Quis est, qui non oderit libidinosam, protervam adolescentiam? Et ille ridens: Video, inquit, quid agas;</p>','Chrysippo praetermissum'),(142,723,2,'2022-02-21 19:13:54','2022-02-22 07:13:11','b82c536b-aa07-4809-a0a3-f531aea8315d','<p>Quo igitur, inquit, modo? Sed ille, ut dixi, vitiose. Quantum Aristoxeni ingenium consumptum videmus in musicis? Igitur ne dolorem quidem. An eiusdem modi? Nemo igitur esse beatus potest.<br /><br />Quo tandem modo? Duo Reges: constructio interrete. Beatum, inquit. Ea possunt paria non esse. Sic consequentibus vestris sublatis prima tolluntur. Et non ex maxima parte de tota iudicabis?<br /><br />Que Manilium, ab iisque M. Primum in nostrane potestate est, quid meminerimus? Videamus igitur sententias eorum, tum ad verba redeamus. Sed vos squalidius, illorum vides quam niteat oratio. Videamus igitur sententias eorum, tum ad verba redeamus. Omnis enim est natura diligens sui. Recte, inquit, intellegis.</p>','Nummus in Croesi'),(143,726,2,'2022-02-21 19:13:54','2022-02-21 19:13:54','ca582a63-c088-4d4b-bd39-074996fc1fd5','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>','Lorem ipsum'),(144,727,2,'2022-02-21 19:13:54','2022-02-21 19:13:54','de73fdda-1cf6-45b7-8cd5-eed476b04c9f','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam. Quid est, quod ab ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>','Chrysippo praetermissum'),(145,728,2,'2022-02-21 19:13:54','2022-02-21 19:13:54','c51ffcc2-cb6d-4d20-b063-828ae94a0807','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, 