;</p>','Chrysippo praetermissum'),(286,1790,2,'2022-02-22 07:13:11','2022-02-22 07:13:11','ba5eec39-182d-49f0-b073-f2442f523fb2','<p>Quo igitur, inquit, modo? Sed ille, ut dixi, vitiose. Quantum Aristoxeni ingenium consumptum videmus in musicis? Igitur ne dolorem quidem. An eiusdem modi? Nemo igitur esse beatus potest.<br /><br />Quo tandem modo? Duo Reges: constructio interrete. Beatum, inquit. Ea possunt paria non esse. Sic consequentibus vestris sublatis prima tolluntur. Et non ex maxima parte de tota iudicabis?<br /><br />Que Manilium, ab iisque M. Primum in nostrane potestate est, quid meminerimus? Videamus igitur sententias eorum, tum ad verba redeamus. Sed vos squalidius, illorum vides quam niteat oratio. Videamus igitur sententias eorum, tum ad verba redeamus. Omnis enim est natura diligens sui. Recte, inquit, intellegis.</p>','Nummus in Croesi'),(296,1806,2,'2022-02-22 07:20:05','2022-02-22 07:20:05','9f4cbc51-f335-4be4-9318-672fbfb4809b','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>','Lorem ipsum'),(297,1807,2,'2022-02-22 07:20:05','2022-02-22 07:20:05','5590635b-9cf0-4e6d-ba40-bd311cb70e9d','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam. Quid est, quod ab ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>','Chrysippo praetermissum'),(298,1808,2,'2022-02-22 07:20:05','2022-02-22 07:20:05','d70da30c-893d-43a4-96d6-3e9f659318d5','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omn