espondere, quae a te dicta sunt.</p>\n<p>Si longus, levis. Quae quidem vel cum periculo est quaerenda vobis; Ubi ut eam caperet aut quando? Multoque hoc melius nos veriusque quam Stoici. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Tu enim ista lenius, hic Stoicorum more nos vexat. Philosophi autem in suis lectulis plerumque moriuntur.</p>','Consectetur'),(419,1988,2,'2022-02-22 07:33:41','2022-02-22 07:33:41','9f28b0d6-838d-4be1-a877-c22685718c73','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Qui non moveatur et offensione turpitudinis et comprobatione honestatis?</p>','Lorem ipsum'),(420,1989,2,'2022-02-22 07:33:41','2022-02-22 07:33:41','f991a272-bba8-4e09-8737-0f3d919cc33f','<p>Quid enim est a Chrysippo praetermissum in Stoicis? Quis enim est, qui non videat haec esse in natura rerum tria? Huius ego nunc auctoritatem sequens idem faciam. Quid est, quod ab ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>','Chrysippo praetermissum'),(421,1990,2,'2022-02-22 07:33:41','2022-02-22 07:33:41','81c77b78-7e26-47ec-a256-b554f39f1874','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Quae si potest singula consolando levare, universa quo modo sustinebit? Frater et T. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus.</p>','Nummus in Croesi'),(422,1992,2,'2022-02-22 07:33:41','2022-02-22 07:33:41','1f536b3f-d3d7-4f11-90bb-70e03126ba4d','<p>Consectetur adipiscing elit. Cur id non ita fit? Sin dicit obscurari quaedam nec apparere, quia valde p