 ea absolvi et perfici debeat? Idem iste, inquam, de voluptate quid sentit? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi.</p>','Chrysippo praetermissum'),(628,4731,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','d62d39ef-cde1-44e6-979f-cff24742583d','<p>Divitiis obscuratur, pars est tamen divitiarum. Cur, nisi quod turpis oratio est? Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Quae si potest singula consolando levare, universa quo modo sustinebit? Frater et T. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus.</p>','Nummus in Croesi'),(629,4733,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','f83f17a1-1d5e-4d2f-9ad2-b510e494bffc','<h2>Lorem ipsum dolor sit amet</h2>\n<p>Consectetur adipiscing elit. Urgent tamen et nihil remittunt. Equidem e Cn. Quid ait Aristoteles reliquique Platonis alumni? Duo Reges: constructio interrete. At certe gravius. Hoc loco tenere se Triarius non potuit. Ratio quidem vestra sic cogit. Dat enim intervalla et relaxat.<br /></p><ul class=\"checkmarks\"><li>At ego quem huic anteponam non audeo dicere; Quis negat? Nos commodius agimus. Honesta oratio, Socratica, Platonis etiam.</li><li>Quippe: habes enim a rhetoribus; Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Quod totum contra est. Tria genera bonorum;</li></ul>\n<p>Tum Torquatus: Prorsus, inquit, assentior; Nos commodius agimus. Quid ergo hoc loco intellegit honestum? Ecce aliud simile dissimile. Estne, quaeso, inquam, sitienti in bibendo voluptas? Vide, quantum, inquam, fallare, Torquate. Nullus est igitur cuiusquam dies natalis.</p>','Lorem ipsum'),(630,4734,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','124d4817-a8d0-4ef4-9fe6-0658c0973aa1','<p>Iam contemni non poteris. Haec et tu ita posuisti, et verba vestra sunt. Zenonis est, inquam, hoc Stoici. Sed quid sentiat, non videtis. Eadem nunc mea adversum te oratio est. Inde igitur, inquit, ordiendum est. Scrupulum, inquam, abeunti;<br /><br />Pauca mutat vel plura sane; Duo Reges: constructio interrete. Teneo, inquit, finem illi videri nihil dolere. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Non laboro, inquit, de nomine.<br /><br />Eadem nunc mea adversum te oratio est. Sed ego in hoc resisto; Deprehensus omnem poenam contemnet. At cum de plurimis eadem dicit, tum certe de maximis. Respondent extrema primis, media utrisque, omnia omnibus. Facillimum id quidem est, inquam.<br /><br />Quis est, qui non oderit libidinosam, protervam adolescentiam? Et ille ridens: Video, inquit, quid agas;</p>','Chrysippo praetermissum'),(631,4735,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','44d885c1-5ce3-49d3-b61b-7dbccd80f960','<p>Quo igitur, inquit, modo? Sed ille, ut dixi, vitiose. Quantum Aristoxeni ingenium consumptum videmus in musicis? Igitur ne dolorem quidem. An eiusdem modi? Nemo igitur esse beatus potest.<br /><br />Quo tandem modo? Duo Reges: constructio interrete. Beatum, inquit. Ea possunt paria non esse. Sic consequentibus vestris sublatis prima tolluntur. Et non ex maxima parte de tota iudicabis?<br /><br />Que Manilium, ab iisque M. Primum in nostrane potestate est, quid meminerimus? Videamus igitur sententias eorum, tum ad verba redeamus. Sed vos squalidius, illorum vides quam niteat oratio. Videamus igitur sententias eorum, tum ad verba redeamus. Omnis enim est natura diligens sui. Recte, inquit, intellegis.</p>','Nummus in Croesi'),(632,4737,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','1486bb09-145b-47b7-90e4-e9587d8867f8','<h2>Tum mihi Piso</h2>\n<p>Quid ergo? Quod cum dixissent, ille contra. Hoc loco tenere se Triarius non potuit. Sed ne, dum huic obsequor, vobis molestus sim. Cum praesertim illa perdiscere ludus esset. At iam decimum annum in spelunca iacet.<br /></p>\n','Lorem ipsum'),(633,4738,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','8b836f5d-5e79-4863-b8c5-37e346317aae','<h2>Consectetur adipiscing elit</h2>\n<p>Praeteritis, inquit, gaudeo. Quare conare, quaeso.</p><ul><li>Sed ad bona praeterita redeamus. Quo tandem modo? An haec ab eo non dicuntur?</li><li>Omnes enim iucundum motum, quo sensus hilaretur. Poterat autem inpune?</li></ul>','Dolor sit amet'),(634,4739,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','5d96d888-ccf0-4f1d-809b-e8d1a39d5a0a','<h2>Si longus, levis</h2>\n<p>Invidiosum nomen est, infame, suspectum. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Eadem nunc mea adversum te oratio est.</p>\n<p>Duo Reges: constructio interrete. Longum est enim ad omnia respondere, quae a te dicta sunt.</p>','Consectetur'),(635,4741,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','73bd13b1-02df-453f-9b9c-b477621a4fbe','<p>Invidiosum nomen est, infame, suspectum. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Eadem nunc mea adversum te oratio est.<br /></p>\n<p>Duo Reges: constructio interrete. Longum est enim ad omnia respondere, quae a te dicta sunt.</p>','Si longus, levis'),(636,4742,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','b19e35d9-dfa1-46c2-8242-832de4d22125','<p>Praeteritis, inquit, gaudeo. Quare conare, quaeso.</p>\n<ul><li>Sed ad bona praeterita redeamus. Quo tandem modo? An haec ab eo non dicuntur?</li><li>Omnes enim iucundum motum, quo sensus hilaretur. Poterat autem inpune?</li></ul>','Consectetur adipiscing elit'),(637,4743,2,'2022-02-23 17:43:05','2022-02-23 17:43:05','a6a4e57b-6df4-470d-9280-c6036b0734b8','<p>Quid ergo? Quod cum dixissent, ille contra. Hoc loco tenere se Triarius non potuit. Sed ne, dum huic obsequor, vobis molestus sim. Cum praesertim illa perdiscere ludus esset. At iam decimum annum in spelunca iacet.</p>','Tum mihi Piso');
